import React from "react";
import "./CasualScreen.css";

function CasualScreen({ profileData, casualData, setCasualData }) {
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setCasualData((prev) => ({ ...prev, [name]: value }));
  };

  const photoPreviewUrl = profileData.photo
    ? URL.createObjectURL(profileData.photo)
    : null;

  return (
    <div className="casual-screen">
      {/* ヘッダー */}
      <div className="header">
        <h2>個人プロフィール</h2>
      </div>

      {/* メインコンテンツ */}
      <div className="content">
        {/* 左側: 写真と基本情報 */}
        <div className="left-section">
          <div
            className="photo"
            style={{
              backgroundImage: photoPreviewUrl
                ? `url(${photoPreviewUrl})`
                : "none",
            }}
          >
            {!photoPreviewUrl && <p>写真未挿入</p>}
          </div>
          <div className="info">
            <h3>{profileData.name || "名前未入力"} (30)</h3>
            <p>最終学歴: {profileData.education || "未入力"}</p>
            <p>職務経歴: {profileData.career || "未入力"}</p>
            <p>
              履歴書:{" "}
              {profileData.resume ? (
                <span
                  className="link"
                  onClick={() => {
                    const fileURL = URL.createObjectURL(profileData.resume);
                    window.open(fileURL, "_blank");
                  }}
                >
                  📎
                </span>
              ) : (
                "未アップロード"
              )}
            </p>
            <p>
              職務経歴書:{" "}
              {profileData.careerSheet ? (
                <span
                  className="link"
                  onClick={() => {
                    const fileURL = URL.createObjectURL(profileData.careerSheet);
                    window.open(fileURL, "_blank");
                  }}
                >
                  📎
                </span>
              ) : (
                "未アップロード"
              )}
            </p>
          </div>
        </div>

        {/* 右側: 判定結果 */}
        <div className="right-section">
          <div className="result-table">
            <div className="result-row">
              <div>判定結果</div>
              <input
                type="text"
                name="result"
                value={casualData.result || ""}
                onChange={handleInputChange}
                className="input-box"
              />
            </div>
            <div className="result-row">
              <div>誠実</div>
              <input
                type="text"
                name="honesty"
                value={casualData.honesty || ""}
                onChange={handleInputChange}
                className="input-box"
              />
            </div>
            <div className="result-row">
              <div>チーム愛</div>
              <input
                type="text"
                name="teamLove"
                value={casualData.teamLove || ""}
                onChange={handleInputChange}
                className="input-box"
              />
            </div>
            <div className="result-row">
              <div>愛嬌</div>
              <input
                type="text"
                name="charm"
                value={casualData.charm || ""}
                onChange={handleInputChange}
                className="input-box"
              />
            </div>
            <div className="result-row">
              <div>謙虚さと責任感</div>
              <input
                type="text"
                name="humility"
                value={casualData.humility || ""}
                onChange={handleInputChange}
                className="input-box"
              />
            </div>
          </div>
          <div className="notes">
            <label>備考記入欄</label>
            <textarea
              name="notes"
              value={casualData.notes || ""}
              onChange={handleInputChange}
              rows="5"
              className="textarea"
            ></textarea>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CasualScreen;
